import React, { useState, useEffect } from 'react';

interface TrainingConfig {
    batchSize: number;
    epochs: number;
    learningRate: number;
    optimizer: string;
    lossFunction: string;
}

interface PropertiesPanelProps {
    initialConfig?: TrainingConfig;
    onConfigUpdate?: (config: TrainingConfig) => void;
}

const PropertiesPanel: React.FC<PropertiesPanelProps> = ({ 
    initialConfig,
    onConfigUpdate 
}) => {
    const [trainingConfig, setTrainingConfig] = useState<TrainingConfig>(
        initialConfig || {
            batchSize: 32,
            epochs: 10,
            learningRate: 0.001,
            optimizer: 'adam',
            lossFunction: 'mse'
        }
    );

    // Update local state when initialConfig changes
    useEffect(() => {
        if (initialConfig) {
            setTrainingConfig(initialConfig);
        }
    }, [initialConfig]);

    // Update parent whenever local config changes
    useEffect(() => {
        if (onConfigUpdate) {
            onConfigUpdate(trainingConfig);
        }
    }, [trainingConfig, onConfigUpdate]);

    return (
        <div style={{ 
            width: 200, 
            borderLeft: '1px solid rgba(255, 255, 255, 0.1)', 
            padding: 16, 
            background: 'linear-gradient(135deg, #0f0f15 0%, #151520 100%)',
            color: '#ffffff',
            height: 'calc(100vh - 80px)',
            overflowY: 'auto',
            boxShadow: '-2px 0 15px rgba(0, 0, 0, 0.2)'
        }}>
            <h3 style={{ 
                color: '#ffffff', 
                marginTop: 0,
                borderBottom: '1px solid rgba(255, 255, 255, 0.1)',
                paddingBottom: '10px',
                fontWeight: 600,
                letterSpacing: '0.5px'
            }}>Training Options</h3>

            <div style={{
                marginTop: '12px',
                display: 'flex',
                flexDirection: 'column',
                gap: '16px'
            }}>
                {/* Batch Size */}
                <div className="training-option">
                    <label style={{ display: 'block', marginBottom: '6px', color: '#b0b8c4', fontSize: '14px', fontWeight: 500 }}>Batch Size</label>
                    <input
                        type="number"
                        value={trainingConfig.batchSize}
                        onChange={(e) => setTrainingConfig(prev => ({ ...prev, batchSize: Number(e.target.value) }))}
                        style={{
                            width: '100%', padding: '8px 10px', background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)', borderRadius: '8px', color: 'white',
                            fontSize: '14px', outline: 'none', boxSizing: 'border-box'
                        }}
                    />
                </div>

                {/* Epochs */}
                <div className="training-option">
                    <label style={{ display: 'block', marginBottom: '6px', color: '#b0b8c4', fontSize: '14px', fontWeight: 500 }}>Epochs</label>
                    <input
                        type="number"
                        value={trainingConfig.epochs}
                        onChange={(e) => setTrainingConfig(prev => ({ ...prev, epochs: Number(e.target.value) }))}
                        style={{
                            width: '100%', padding: '8px 10px', background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)', borderRadius: '8px', color: 'white',
                            fontSize: '14px', outline: 'none', boxSizing: 'border-box'
                        }}
                    />
                </div>

                {/* Learning Rate */}
                <div className="training-option">
                    <label style={{ display: 'block', marginBottom: '6px', color: '#b0b8c4', fontSize: '14px', fontWeight: 500 }}>Learning Rate</label>
                    <input
                        type="number"
                        step="0.0001"
                        value={trainingConfig.learningRate}
                        onChange={(e) => setTrainingConfig(prev => ({ ...prev, learningRate: Number(e.target.value) }))}
                        style={{
                            width: '100%', padding: '8px 10px', background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)', borderRadius: '8px', color: 'white',
                            fontSize: '14px', outline: 'none', boxSizing: 'border-box'
                        }}
                    />
                </div>

                {/* Optimizer */}
                <div className="training-option">
                    <label style={{ display: 'block', marginBottom: '6px', color: '#b0b8c4', fontSize: '14px', fontWeight: 500 }}>Optimizer</label>
                    <select
                        value={trainingConfig.optimizer}
                        onChange={(e) => setTrainingConfig(prev => ({ ...prev, optimizer: e.target.value }))}
                        style={{
                            width: '100%', padding: '8px 10px', background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)', borderRadius: '8px', color: 'white',
                            fontSize: '14px', outline: 'none'
                        }}
                    >
                        <option value="adam">Adam</option>
                        <option value="sgd">SGD</option>
                        <option value="rmsprop">RMSprop</option>
                    </select>
                </div>

                {/* Loss Function */}
                <div className="training-option">
                    <label style={{ display: 'block', marginBottom: '6px', color: '#b0b8c4', fontSize: '14px', fontWeight: 500 }}>Loss Function</label>
                    <select
                        value={trainingConfig.lossFunction}
                        onChange={(e) => setTrainingConfig(prev => ({ ...prev, lossFunction: e.target.value }))}
                        style={{
                            width: '100%', padding: '8px 10px', background: 'rgba(255, 255, 255, 0.07)',
                            border: '1px solid rgba(255, 255, 255, 0.1)', borderRadius: '8px', color: 'white',
                            fontSize: '14px', outline: 'none'
                        }}
                    >
                        <option value="mse">Mean Squared Error</option>
                        <option value="crossentropy">Cross Entropy</option>
                    </select>
                </div>
            </div>
        </div>
    );
};

export default PropertiesPanel;
